  render() {
    return (
      <div>
        <header>
          This is the 1st header
        </header>
        <header>
          This is the 2nd header
        </header>
        <p>
          This is a paragraph
        </p>
      </div>
    )
  }
}

function App() {
  return (
    <div className="App">
      <div className="game-board">
        <Board />
      </div>
    </div>
  );
}



export default App;
